import './App.css';
import { Defaultlayout } from './layout/Defaultlayout';
import { Ticket } from './pages/Ticket/ticketpage';
import { Ticketlist } from './pages/Ticketlist/Ticketlist';
import { Addtickets } from './pages/new_tickets/add_tickets';
import Entry from './pages/Entry/entry';
import { Dashbord } from './pages/Dashbord/dashbord';
import { BrowserRouter, Routes, Route } from "react-router-dom"
import { PrivateRoute } from './components/private-route/privateroute';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
          <Routes>
          <Route exact path ='/' element ={<Entry />}></Route>
          {/* <Defaultlayout> */}

            <PrivateRoute index path='dashboard' element={<Dashbord />}></PrivateRoute>
            <Route path='addticket' element ={<Defaultlayout> <Addtickets /> </Defaultlayout>}> </Route>
            <Route path='tickets' element ={<Defaultlayout><Ticketlist /> </Defaultlayout>}></Route>
            <Route path='tickets:tid' element={<Defaultlayout><Ticket /></Defaultlayout>}></Route>
          {/* </Defaultlayout> */}
        </Routes> 
        </BrowserRouter>
    </div>
  );
}

export default App;
